"<p>This blog platform is powered by b2evolution.</p>\n\n\t<p>You are currently looking at an info page about this site.</p>\n\n\t<p>Info pages are very much like regular posts, except that they do not appear in the regular flow of posts. They appear as info pages in the menu instead.</p>\n\n\t<p>If needed, skins can format info pages differently from regular posts.</p>" => "<p>Эта блог платформа работает на b2evolution.</p>\n\n\t<p>В данный момент вы просматриваете информационную страницу об этом сайте.</p>\n\n\t<p>Информационные страницы очень похожи на обычными записи, за исключением того что они не появляются в обычном потоке записей. Они появляются как информационные страницы в меню.</p>\n\n\t<p>Если необходимо, то темы могут располагать информационные страницы не так как обычные записи.</p>",
'About this site' => 'Об этом сайте',
"<p>This is the Home page of this site.</p>\n\n<p>More specifically it is the \"Front page\" of the first collection of this site. This first collection is called \"Home\". Other sample collections have been created. You can access them by clicking \"Blog A\", \"Blog B\", \"Photos\", etc. in the menu bar at the top of this page.</p>\n\n<p>You can add collections at will. You can also remove them (including this \"Home\" collection) if you don't need one.</p>" => "<p>Это Домашняя страница этого сайта.</p>\n\n<p>Точнее это \"Первая страница\" первой коллекции этого сайта. Эта первая коллекция называется \"Домашняя\". Другие примеры коллекции также были созданы. Вы можете получить к ним доступ, нажав на кнопку \"Блог А\", \"Блог Б\", \"Фотографии\" и т.д. в меню верхней части этой страницы.</p>\n\n<p>Вы можете добавить коллекции по желанию. Вы также можете удалить их (включая эту \"Домашнюю\" коллекцию), если она вам не нужна.</p>",
'Homepage post' => 'Запись домашней страницы',
'Terms & Conditions' => 'Правила и Условия',
